import React from 'react'
import styled, { ThemeProvider } from 'styled-components'
import {lightTheme} from './Themes';
import { Design, Develope} from './AllSvgs';


import LogoComponent from '../subComponents/LogoComponent';
import SocialIcons from '../subComponents/SocialIcons';
import PowerButton from '../subComponents/PowerButton';
import ParticleComponent from '../subComponents/ParticleComponent';
import BigTitle from '../subComponents/BigTitlte'

const Box = styled.div`
background-color: ${props => props.theme.body};
width: 100vw;
height:100vh;
position: relative;
display: flex;
justify-content: space-evenly;
align-items: center;


`

const Main = styled.div`
border: 2px solid ${props => props.theme.text};
color: ${props => props.theme.text};
background-color: ${props => props.theme.body};
padding: .5rem;
width: 35vw;
height: 70vh;
z-index:3;
line-height: 2;
cursor: pointer;

font-family: 'Ubuntu Mono',monospace;
display: flex;
flex-direction: column;
justify-content: space-between;

&:hover{
    color: ${props => props.theme.body};
    background-color: ${props => props.theme.text};
}
`

const Title = styled.h2`
display: flex;
justify-content: center;
align-items: center;
font-size: calc(1em + 1vw);

${Main}:hover &{
    &>*{
        fill:${props => props.theme.body};
    }
}

&>*:first-child{
margin-right: 1rem;
}
`

const Description = styled.div`
color: ${props => props.theme.text};
font-size: calc(0.6em + 1vw);
padding: 0.5rem 0;


${Main}:hover &{

        color:${props => props.theme.body};

}

strong{
    margin-bottom: 1rem;
    text-transform: uppercase;
}
ul,p{
    margin-left: 1rem;
    font-size: 1.05rem;
}
`

const MySkillsPage = () => {
    return (
        <ThemeProvider theme={lightTheme}>
<Box>

<LogoComponent theme='light'/>
<SocialIcons theme='light'/>
<PowerButton />
<ParticleComponent theme='light' />
            <Main>
<Title>
    <Develope width={40} height={40} /> Frontend Developer
</Title>
<Description>
I value business or brand for which i'm creating, thus i enjoy bringing new ideas to life.
</Description>
<Description>
<strong>Skills</strong>
<p>
Html, Css, Js, React, Redux, Sass, Bootstrap, Tailwind, Firebase etc.
</p>
</Description>
<Description>
<strong>Tools</strong>
<p>
jQuery, Git, Postman, GitHub
</p>
</Description>

            </Main>
            <Main>
<Title>
    <Design width={40} height={40} /> Skills
</Title>
<Description>
    <p>
    <strong>Languages:</strong> JavaScript, HTML/CSS, TypeScript
    </p>
    <p>
    <strong>Frameworks:</strong> ReactJS, NodeJS, Express, React Native, Bootstrap, SASS, Material UI, Redux, Gatsby, Contenful, Strapi
    </p>
    <p>
    <strong>Tools:</strong> VSCode, jQuery, Git, Postman, GitHub
    </p>
    <p>
    <strong>Databases:</strong> PostgreSQL, GraphQL, MongoDB, Firebase
    </p>
    <p>
    <strong>Graphics:</strong> Canva, AdobeXD
    </p>
    <p>
    <strong>Hosting:</strong> DigitalOcean, Netlify, Firebase
    </p>
    <p>
    <strong>Other:</strong> Formspree.io, Auth0, Fusion Charts, Snipcart, Socket.io, Context API, Google Maps API, GitHub API, Asana, Jira, Slack, Docker, Figma
    </p>
</Description>

            </Main>

            <BigTitle text="SKILLS" top="80%" right="30%" />

        </Box>

        </ThemeProvider>

    )
}

export default MySkillsPage
